if mibBuilder.loadTexts: job_info_settings_vertical_resolution.setDescription('Indicates the vertical resolution used when the job was printed. See DEFAULT-VERTICAL-BLACK-RESOLUTION.')
job_info_settings_horizontal_resolution = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 5, 21, 3), Integer32()).setLabel("job-info-settings-horizontal-resolution").setMaxAccess("readonly")
