if mibBuilder.loadTexts: job_info_settings_horizontal_resolution.setDescription('Indicates the horizontal resolution used when the job was printed. See DEFAULT-HORIZONTAL-BLACK-RESOLUTION.')
job_info_settings_orientation = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 5, 21, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("ePortrait", 1), ("eLandscape", 2), ("eReversePostrait", 3), ("eReverseLandscape", 4)))).setLabel("job-info-settings-orientation").setMaxAccess("readonly")
if mibBuilder.loadTexts: job_info_settings_orientation.setStatus('optional')
if mibBuilder.loadTexts: job_info_settings_orientation.setDescription('Indicates the orentation setting used when the job was printed. See DEFAULT-ORIENTATION.')
job_info_settings_economode = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 5, 21, 11), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("eOff", 1), ("eOn", 2)))).setLabel("job-info-settings-economode").setMaxAccess("readonly")
if mibBuilder.loadTexts: job_info_settings_economode.setStatus('optional')
if mibBuilder.loadTexts: job_info_settings_economode.setDescription("Indicates the value for the ECONOMODE variable which indicates the user's intent for the toner-saving mode. There are two options: OFF: ECONOMODE is off and the job is printing normally. ON: ECONOMODE is on and the job is pringed with toner saving. ")
job_info_physical_outbins_used = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 5, 22), OctetString()).setLabel("job-info-physical-outbins-used").setMaxAccess("readonly")
if mibBuilder.loadTexts: job_info_physical_outbins_used.setStatus('optional')
if mibBuilder.loadTexts: job_info_physical_outbins_used.setDescription("Indicates which physical output bins this job has delivered printed pages to. The last OID field for this dynamic object contains the job ID. Additional information: The output bins designated by the bits of this collection include the standard output bin(s) plus the physical bins of attached external paper handling devices. The configuration (if any) of external paper handling devices will determine the mapping of individual bits in this collection to the physical bins of the devices. For Lj4100 and LJ4550, the cOutbin1 is used for Face Down bin, cOutbin2 is used for Face Up bin, and 3-15 are used for the 13 optional output bins (12 plus an extension to the Face Up bin) for backwards compatibility with Lj8000/LJ8100 and forwards compatibility with LJ8150. However, since they cannot distinguish output going to the Face Up or Face Down bin in the firmware because the diverter can only be moved manually, bit 0 (cOutbin1) is being used to designate both of these bits together. If an external paper handling output device is connected, then bit 2 (cOutbin3) will represent the device's first output bin (and so on).")
job_info_attr_1 = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 6, 5, 23, 1), OctetString().subtype(subtypeSpec=ValueSizeConstraint(1, 80))).setLabel("job-info-attr-1").setMaxAccess("readonly")
if mibBuilder.loadTexts: job_info_attr_1.setStatus('optional')
if mibBuilder.loadTexts: job_info_attr_1.setDescription('Returns the value that was set in PJL via the SET JOBATTR= command. Attribute objects are saved sequentially, starting with 1, after the start of a job. If more attributes are set than there are objects to store them, the excess JOBATTR values are ignored. If the corresponding SET JOBATTR= command has not been received when a get is done for this object, a status of <noSuchName> will be returned.')
