mono_color_switching_mode = MibScalar((1, 3, 6, 1, 4, 1, 11, 2, 3, 9, 4, 2, 1, 1, 1, 31), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("eAutoSwitch", 1), ("eAlwaysSwitch", 2), ("eLookAheadSwitch", 3)))).setLabel("mono-color-switching-mode").setMaxAccess("readwrite")
